import React from 'react';

const LetterSpacing = () => {
  const letterSpacings = [
    { id: 104, classTitle: 'Default', classValue: 'lsDefault' },
    { id: 101, classTitle: 'Small', classValue: 'lsSM' },
    { id: 102, classTitle: 'Medium', classValue: 'lsMD' },
    { id: 103, classTitle: 'Large', classValue: 'lsLG' },
  ];

  return (
    <>
      <div className='containerFluid1 container1-lg'>
        <div className='sectionTitle fontStyled primary'>
          <h5 className='fsH5 pb2'>Letter Spacing</h5>
          <h6 className='fsSM pb1'>Classes Names</h6>
        </div>

        {letterSpacings.map((ls) => (
          <div key={ls.id} className='row alignCenter mb1'>
            <div className='col6 col3-xs col3-sm fwBold'>
              <p className='fsSM'>.{ls.classValue}:</p>
            </div>

            <div className='col6 col9-xs col9-sm'>
              <div className='row flexColumn flexRow-xs'>
                <div className='col12 col4-xs col3-md'>
                  <h5 className={`fsMD fontDefault ${ls.classValue}`}>
                    {ls.classTitle}
                  </h5>
                </div>
                <div className='col12 col4-xs col3-md'>
                  <h5 className={`fsMD fontStyled ${ls.classValue}`}>
                    {ls.classTitle}
                  </h5>
                </div>
                <div className='col12 col4-xs col3-md'>
                  <h5 className={`fsMD fontAccent ${ls.classValue}`}>
                    {ls.classTitle}
                  </h5>
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>
    </>
  );
};

export default LetterSpacing;
